import { Box, Grid, GridCol } from 'your-ui-library'; // Replace 'your-ui-library' with your actual UI library

function BlankBoxGrid({ numRows, numCols, boxHeight }) {
  const generateBlankBoxes = () => {
    const blankBoxes = [];

    for (let row = 0; row < numRows; row++) {
      const rowBoxes = [];
      for (let col = 0; col < numCols; col++) {
        rowBoxes.push(
          <GridCol key={col} span={4}>
            <Box bg="white" h={boxHeight} style={{ border: "1px solid #000000" }}>
              {/* This is a blank box with a height of {boxHeight}px */}
            </Box>
          </GridCol>
        );
      }
      blankBoxes.push(
        <Grid key={row} ml="xs" mr="xs">
          {rowBoxes}
        </Grid>
      );
    }

    return blankBoxes;
  };

  return <>{generateBlankBoxes()}</>;
}

// Usage
<BlankBoxGrid numRows={3} numCols={3} boxHeight={60} />;
